const OrderConfirmation
= () => {

  return (
    <div>
      <AppNavbar/>
      <Container fluid>
        <h3>Thank you for your order!</h3>
        <Button color="primary" tag={Link} to="/products">Home</Button>
      </Container>
    </div>
  );
};

export default OrderConfirmation;
